import React, { Component } from "react";

class About extends Component {
    render() {
        return(
            <section className="mw7-ns mw6-m mw5 lh-copy center">
                <h2> About Me</h2>
                <p> An artist from Santa Fe Argentina working in various mediums of art including tattoo, ink/illustration, clothing design & embroidery and much more.</p>

                </section>
        )
    }
}

export default About;
